import { Header } from './components/Header'
import { Body } from './components/Body'
import { Speciality } from './components/Speciality'
import { About } from './components/About'
import { Skills } from './components/Skills'
import { Contact } from './components/Contact'


function App() {
  const items = [{value:"Glavnya", href: "/main", icons: "logout"},{value:"Home", href: "/service", icons: "thumb_up"},{value:"Otsos", href: "/shop", icons: "task_alt"}, ]
  return (

    <div className="App">
          <Header title={''}/>
          <Body title={''}/>
          <Speciality title={''}/>
          <About title={''}/>
          <Skills title={''}/>
          <Contact title={''}/>
          <Menu header={"Burger"} items={items}/>
    </div>
  );
}

export default App;
